import React, { useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
// (Add other imports, e.g., DisclosureFlow if you have it)

function App() {
  const [user, setUser] = useState(null);
  const [progress, setProgress] = useState({ completed: 1, total: 3 });

  const handleLogin = (userData) => setUser(userData);
  const handleStartDisclosure = () => { /* navigation logic below */ };

  return (
    <Routes>
      <Route 
        path="/" 
        element={
          !user ? 
          <Login onLogin={handleLogin} /> : 
          <Dashboard progress={progress} onStartDisclosure={handleStartDisclosure} />
        } 
      />
      <Route path="/login" element={<Login onLogin={setUser} />} />
      <Route path="/dashboard" element={<Dashboard progress={{completed: 1, total: 3}} onStartDisclosure={() => {}} />} />
      {/* Example of adding a Disclosure Flow route */}
      {/* <Route path="/disclosure" element={<DisclosureFlow />} /> */}
    </Routes>
  );
}

export default App;
